import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './AppointmentsList.css';

import { useAppointments } from './AppointmentsContext'; // Import the hook

function AppointmentsList() {
    const { appointments, fetchAppointments } = useAppointments(); // Use the context

    useEffect(() => {
        fetchAppointments(); // Fetch appointments on component mount
    }, []);

    return (
        <div className="list-container">
          <h2>Appointments</h2>
          <ul>
            {appointments.map(appointment => (
              <li key={appointment.id} className="list-item">
                {appointment.patient_name} - {appointment.appointment_date}
              </li>
            ))}
          </ul>
        </div>
      );
}

export default AppointmentsList;
